import React from "react";
import { connect } from "react-redux";
import { setBuyPokemon, setReturnPokemon } from "../actions/Pokemon";

const CompraPokemon = () => (
    <>
        <button className="btn btn-dark btn-sm mb-2" onClick={setBuyPokemon}>
            Comprar Pokemon
        </button>
        <button
            className="btn btn-dark btn-sm"
            onClick={() => setReturnPokemon(1)}
        >
            Regresar Pokemon
        </button>
    </>
);

const mapDispatchToProps = (dispatch) => ({
    setBuyPokemon: () => dispatch(setBuyPokemon()),
});

export default connect(null, mapDispatchToProps)(CompraPokemon);
